import React from 'react';
import './subHeader.scss';

import searchIcon from './assets/search.svg';
import userIcon from './assets/user.svg';
import ararmIcon from './assets/arart.svg';
import addIcon from './assets/add-user.svg';
import arrowIcon from './assets/arrow.svg';
import calendarIcon from './assets/calendar.svg';
import menuIcon from './assets/menu.svg';
import blockIcon from './assets/block.svg';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faUser, faDisplay, faGear } from '@fortawesome/free-solid-svg-icons';



class SubHeader extends React.Component {
  render() {
    return (
      <div className="subHeader-bg">
          <div className="main-header">
            <div>
              <FontAwesomeIcon icon={faUser}  className="fa fa-user fa-lg fa-fw" aria-hidden="true" />
              <input type="text" placeholder='Search'/>
              <input type="submit" />
            </div>
            <div>
              <img src={ userIcon } alt="Icon"/>
              <span><a>Hi, Text John</a></span>
              <img src={ ararmIcon } alt="Icon"/>
              <img src={ addIcon } alt="Icon"/>
            </div>
          </div>
          <div className="sub-header">
            <div>
              <img src={ searchIcon } alt="Icon"/>
              <a>Search</a>
            </div>
            <div>
              <span>
                <a>show:All</a>
                <img src={ arrowIcon} alt="Icon"/>
              </span>
              <img src={ calendarIcon } alt="Icon"/>
              <img src={ menuIcon } alt="Icon"/>
              <img src={ blockIcon } alt="Icon"/>
            </div>
          </div>
      </div>
    );
  }
}

export default SubHeader;
